double computeDeterminant(double matrix[N][N])
{
    /*int nbPermutation = 0;
    int imax = 0;
    for(int i = 0; i < N-1; ++i)
    {
        imax = i;
        for(int j = i+1;j < N; ++j)
            if(fabs(matrix[imax][i]) < matrix[j][i])
                imax = j;

        for(int j = 0; j < N; ++j)
            std::swap(matrix[i][j],matrix[imax][j]);

        if(imax != i)
        {
            ++nbPermutation;
        }
    }
    double det = (nbPermutation%2 == 0) ? 1 : -1;*/

    double det = 1;

    double factor;
    for(int i = 0;i < N-1; ++i)
        for(int j = i+1;j < N; ++j)
        {
            factor = matrix[j][i] / matrix[i][i];
            for(int k = i; k < N; ++k)
                matrix[j][k] -= factor * matrix[i][k];
        }


    for(int i = 0;i < N; ++i)
        det *= matrix[i][i];
    return det;
}

void display(double** matrix)
{
    for(int i = 0; i < N; ++i)
    {
        for(int j = 0;j < N; ++j)
            std::cout << matrix[i][j] << "   ";
        std::cout << std::endl;
    }
}

